#include <iostream>

int main() {
	int a, A, b, B, c, C, d, D;
	std::cin >> a >> A;
	std::cin >> b >> B;
	std::cin >> c >> C;
	std::cin >> d >> D;
	if ((a - b)*(A - B) > (c - d)*(C - D)) {
		if ((a - b)*(A - B) % (c - d)*(C - D) == 0) {
			std::cout << "Intersect" << std::endl;
		}
		else {
			std::cout << "Parallel" << std::endl;
		}
	}
	else {
		if ((c - d)*(C - D) % (a - b)*(A - B) == 0) {
			std::cout << "Intersect" << std::endl;
		}
		else {
			std::cout << "Parallel" << std::endl;
		}
	}
	return 0;
}
